    {
        UserModel u = new UserModel
        {
            FirstName = newUser.FirstName,
            LastName = newUser.LastName,
            EmailAddress = newUser.EmailAddress
        };

        await _userDb.InsertUser(u);

        users.Add(u);

        newUser = new DisplayUserModel();
